import {FooterBoxStyled,
    NavMenu,
    NavMenuLi,
    NavMenuElement,
    LogoFooter
} from "./Footer.styled"

import image from "../../../assets/shared/desktop/logo.svg"
<img
src={image}
alt="coffee"
></img>


export const Footer = () => {
    return (
    <FooterBoxStyled>
        <LogoFooter></LogoFooter>
        <NavMenu>
            <NavMenuLi><NavMenuElement>HOME</NavMenuElement></NavMenuLi>
            <NavMenuLi><NavMenuElement>ABOUT US</NavMenuElement></NavMenuLi>
            <NavMenuLi><NavMenuElement>CREATE YOUR PLAN</NavMenuElement></NavMenuLi>
        </NavMenu>
        <ul>
            <li></li>
            <li></li>
            <li></li>
        </ul>
    </FooterBoxStyled>
    );
  };
